import React from "react";
import { GoogleMap, withScriptjs, withGoogleMap } from "react-google-map";

function Map() {
  return <GoogleMap defaultZoom={10} defaultCenter={{ lat: 46, lng: -75 }} />;
}

function MapIp({ cordinates }) {
  return <div></div>;
}

export default MapIp;
